<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <title>302 Redirection for www.jospeh.net</title>
    <link rel="canonical" href="https://www.jospeh.net">
    <script type='text/javascript'> 

        var dest = "https://www.jospeh.net";
        
        function canonicalLink() { 
            var link = document.getElementsByTagName("link")[0]; 
            link.setAttribute('href', dest + location.pathname); 
            document.head.appendChild(link);
        } 
        
        canonicalLink(); 
        location.href = dest;
    </script> 
    </head> 
    <body>
        <!-- 302 Redirection for www.jospeh.net -->
    </body> 
</html>
